import React from 'react';
import './App.css';


function App() {
  return (
    <div className="App">
      <div className="Directory">
        <div className="Box">
          <div className="Content">SHOES</div>
        </div>
        <div className="Box">
          <div className="Content">HATS</div>
        </div>
        <div className="Box">
          <div className="Content">SHIRTS</div>
        </div>
        <div className="Box">
          <div className="Content">WOMEN</div>
        </div>
        <div className="Box">
          <div className="Content">MEN</div>
        </div>









      </div>
    </div>
  );
}

export default App;
